import { FastField } from "formik";
import React, { useEffect } from "react";

export const TypesOfAtt = ({ name, typeAtt, rowData }) => {
  console.log("typeOfAtt");
  useEffect(() => {
    console.log(typeAtt);
    console.log(typeAtt.map((item) => item.unit));
  }, [typeAtt]);
  return (
    <div className="">
      {rowData.categories.map((item) => {
        return (
          <div className="container">
            <div className="text-center fs-5 m-3">
              <span>گروه : {item.title}</span>
            </div>

            {typeAtt.length ? (
              typeAtt.map((item) => (
                <div className="input-group py-1">
                  <span
                    className="input-group-text w-25 d-flex justify-content-center"
                    htmlFor=""
                  >
                    {item.title}
                  </span>
                  <FastField
                    name={name}
                    type="input"
                    className="form-control"
                  />
                  <span
                    className="input-group-text w-25 d-flex justify-content-center"
                    htmlFor=""
                  >
                    {item.unit}
                  </span>
                </div>
              ))
            ) : (
              <div className="text-primary text-center p-5 fs-3">هیچ ویژگی یافت نشد...</div>
            )}
          </div>
        );
      })}
    </div>
  );
};
